import React, { Component } from "react";
import { Redirect, Route } from "react-router-dom";

class User extends Component {



    // signOut = () => {
    //     this.props.logout()
    // }


    render() {

        if(this.props.isLoggedin){
            return(
                <Redirect to="/home"/>
            )
        }

        return (
            <div>
                <div className="row" style={{"margin":"0", "overflow-x":"hidden"}}>
                    <div className="col-md-4 grey darken-4">
                        <br/><br/>
                        <h4 className="mt-2 ml-5"><i class="fa fa-youtube-play fa-3x text-light" aria-hidden="true"></i></h4>
                        <h3 className="ml-5 text-white font-weight-bold">The new Youtube Music is coming soon.</h3>
                        <br/><br/>
                        <Route path="/">
                            <Login/>
                        </Route>
                        <Route path="/signup" exact>
                            <SignUp/>
                        </Route>
                       <br/><br/><br/><br/><br/>
                        <footer className="text-center">
                        <small class="text-secondary"><strong> &copy; 2020 Youtube. All Rights Reserved.</strong></small>
                            <div className="text-secondary "> Terms &nbsp;&nbsp; Privacy &nbsp;&nbsp; Policy</div>
                        </footer>
                    </div>
                        <div className="col-md-6 p-0">
                            <img height="790px" src={require("./image-3.jpg")} alt=""/>
                        </div>
                </div>
            </div>
        )
    }
}

export default User
